import { useState } from "react";
import "./App.css";

function App() {
  const [value, setValue] = useState(0);
  const [listValue, setList] = useState(0);

  const outputArray = (value) => {
    let list = [];
    for (let i = 1; i <= value; i++) {
      if (i % 5 === 0 && i % 3 === 0) {
        list.push("FizzBuzz");
        // alert(i)
      } else if (i % 5 === 0) {
        list.push("Fizz");
        // alert(i)
      } else if (i % 3 === 0) {
        list.push("Buzz");
        // alert(i)
      } else {
        list.push(String(i));
        // alert(String(i))
      }
    }
    setList(list);
    {listValue.map((each,index) => {
      <h1>{each}</h1>;
    })}
    console.log(list);
  };

  return (
    <div className="App">
      <input onKeyUp={(e) => setValue(e.target.value)} />
      <input type="submit" value="submit" onClick={() => outputArray(value)} />
      {value}

    </div>
  );
}

export default App;
